.
I love weekend getaways! We haven’t had many of them during quarantine which has been a bummer, but I’m super excited to be taking off for a long weekend ☀️
I am very much a planner but we like to be somewhat flexible with ideas of what to do so we aren’t scrambling at the last minute. And you better believe this includes food options! 🍤🍳🍎🍜🍩🥗
.
Here’s some things I do to prep for an enjoyable weekend getaway! 👇🏼
.
🌴Research local restaurants.
There’s nothing I love more than eating local! I will do it as often as I can while traveling. Typically I’ll use Yelp or Google to find good places to enjoy, or we’ll ask the locals once we’re there—you find the best places when you ask around! A lot of times I remember the food most about our trips, so this is key for me👌🏼
.
🌴Make a packing list.
I’m a CLASSIC overpacker—even when I’m only going for a weekend! I’ve always got to have options, because who knows if you’re going to feel like wearing a dress that one night instead of jeans?! 💁🏻‍♀️ But keeping a packing list handy helps me be organized & also ensures I don’t forget anything ✔️
.
🌴Plan some down time.
As much as I love to be doing something, exploring, or just moving in general....it really is nice to relax & do absolutely nothing 😎 It is a vacation after all, right?!
.
🌴Spend time away from social media.
Sure it’s fun to document your time away, but maybe this time you don’t log into Instagram or Snapchat every 5 seconds to add it to your story. The posts can wait—go live your life & ENJOY these moments!! ☺️
.
You know what I usually *don’t* do?!
🔻Worry about tracking food
🔻Panic if I don’t workout at all
🔻Stress about looking “perfect” in whatever pictures we take
.
Vacations should be about enjoying the time away, not stressing about staying on track the whole time!
A few days of enjoyment will NOT put you that far off track from your goals, I promise 😉
.
I hope the next time you are able to go somewhere fun that you stop stressing & start ENJOYING yourself! ☀️
